import Members from '../members/members';
import Canvas from '../canvas/canvas';


function Main() {
  return (
    <>
    <div>
    <div className="d-flex justify-content-center inline-block">
  <Members/>
  </div>,
  <Canvas />
  </div>
  </>);
}

export default Main;
